import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';

import './topbar.css';
import TopBarLogo from './logo_hanshin.svg';

const TopBar = () => {
  return <div className='muNavBarContainer'>
    <Navbar className='muNavBar'>
        <Navbar.Brand href='/' className='muNavBarLogoContainer'>
          <img src={TopBarLogo} />
        </Navbar.Brand>


        <NavDropdown flip align='end' title="Dropdown" className='muNavBarDropdown'>
          <NavDropdown.Item href="#action/3.1">로그인을 해 주세요!</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">로그인</NavDropdown.Item>
        </NavDropdown>

    </Navbar>
  </div>;
}

export { TopBar };
